// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Scorecard{
    uint256 count=0;
    address public classTeacher;

    // address of the owner of the smart constract
    constructor(){
        classTeacher = msg.sender;
    }

    // modifier used to modify the behaviour of a function. 
    //eg- prerequesite condition to a function
    modifier onlyClassTeacher(address _classTeacher){
        require(classTeacher==_classTeacher," only class teacher has access to this function");
        _;
    }

    struct StudentDet{
        string studentFirstName;
        string studentLastName;
        uint256 id;
    }
    struct Score{
        uint256 studentId;
        uint256 engMarks;
        uint256 mathMarks;
        uint256 sciMarks;
    }

    mapping(uint =>StudentDet) students;

    mapping(uint => Score) scores;

    event studentAdded(string _studentFirstName, string _studentLastName,uint256 _studentId);

    event studentScoresRecorded(uint256 _studentId, uint256 _engMarks, uint256 _mathMarks, uint256 _sciMarks);

    function addStudentDetails (string memory _studentFirstName,
                                string memory _studentLastName) public onlyClassTeacher(msg.sender){
        StudentDet storage studentObj=students[count];
        studentObj.studentFirstName=_studentFirstName;
        studentObj.studentLastName=_studentLastName;
        studentObj.id=count;
        emit studentAdded(_studentFirstName,_studentLastName,count);
        count++;
        
    }

    function addStudentScores( uint _studentId,
                                uint _engMarks,
                                uint _mathMarks,
                                uint _sciMarks ) public onlyClassTeacher(msg.sender) {

    Score storage scoreObj=scores[_studentId];
    scoreObj.engMarks=_engMarks;
    scoreObj.mathMarks=_mathMarks;
    scoreObj.sciMarks=_sciMarks;
    scoreObj.studentId=_studentId;
    emit studentScoresRecorded(_studentId,_engMarks,_mathMarks,_sciMarks);
     }

}
